import * as style from "../css/phoneListContainer"

export default function ListUserItem(props) {
  return (
    <div style={style.phoneListContainer}>
      <div style={style.phoneListContainerMAC}>
        {props.id}
      </div>
      <div style={style.phoneListContainerInfo}>
        <ul style={style.phoneListContainerItems}>
          <li style={style.phoneListContainerItem}>
            {props.name}
          </li>
          <li style={style.phoneListContainerItem}>
            {props.primary}
          </li>
          <li style={style.phoneListContainerItem}>
            {props.department}
          </li>
          <li style={style.phoneListContainerItem}>
            {props.device}
          </li>
          <li style={style.phoneListContainerItem}>
            {props.location}
          </li>
        </ul>
      </div>
    </div>
  )
}
